import React from 'react';
import styled from 'styled-components';
import Slider from 'react-slick';
import PlaceCard from './PlaceCard';
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

const SliderContainer = styled.div`
  .slick-slide {
    display: flex;
    justify-content: center;
    padding: 10px;
  }
`;

const PlaceList = ({ places }) => {
  const settings = {
    dots: true,
    infinite: false,
    speed: 500,
    slidesToShow: 4,
    slidesToScroll: 1,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 1,
          infinite: true,
          dots: true
        }
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 1,
          initialSlide: 2
        }
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1
        }
      }
    ]
  };

  return (
    <SliderContainer>
      <Slider {...settings}>
        {places.map((place) => (
          <PlaceCard key={place.id} place={place} />
        ))}
      </Slider>
    </SliderContainer>
  );
};

export default PlaceList;
